void mix_fir_coeffs( int* upsample_cc, int* fir_cc, int nn, int rr )
{
    int ll = nn/rr;
    for( int ii = 0; ii < rr; ++ii ) {
        for( int jj = 0; jj < ll; ++jj ) {
            upsample_cc[ ii*ll+jj ] = fir_cc[jj*rr+ii];
        }
    }
}

