int dsp_biquad( int xx, const int* cc, int* ss, int nn )
{
    for( ;; )
    {
        switch( nn )
        {
            case  4: { _dsp_biquad4( xx, cc, ss ); } return xx;
            case  3: { _dsp_biquad3( xx, cc, ss ); } return xx;
            case  2: { _dsp_biquad2( xx, cc, ss ); } return xx;
            case  1: { _dsp_biquad1( xx, cc, ss ); } return xx;
            default: { _dsp_biquad4( xx, cc, ss ); } nn -= 4; cc += 20; ss += 16; break;
        }
    }
    return xx;
}

#define _CONVOLVE_2a(nn) \
    asm("ldd   %0,%1,%2[%3]":"=r"(b1),"=r"(b0):"r"(cc),"r"(nn)); \
    asm("ldd   %0,%1,%2[%3]":"=r"(s2),"=r"(s1):"r"(ss),"r"(nn)); \
    asm("std   %0,%1,%2[%3]"::"r"(s1), "r"(s0),"r"(ss),"r"(nn)); \
    asm("maccs %0,%1,%2,%3" :"=r"(ah),"=r"(al):"r"(b0),"r"(s0), "0"(ah),"1"(al)); \
    asm("maccs %0,%1,%2,%3" :"=r"(ah),"=r"(al):"r"(b1),"r"(s1), "0"(ah),"1"(al));

#define _CONVOLVE_2b(nn) \
    asm("ldd   %0,%1,%2[%3]":"=r"(b1),"=r"(b0):"r"(cc),"r"(nn)); \
    asm("ldd   %0,%1,%2[%3]":"=r"(s0),"=r"(s3):"r"(ss),"r"(nn)); \
    asm("std   %0,%1,%2[%3]"::"r"(s3), "r"(s2),"r"(ss),"r"(nn)); \
    asm("maccs %0,%1,%2,%3" :"=r"(ah),"=r"(al):"r"(b0),"r"(s2), "0"(ah),"1"(al)); \
    asm("maccs %0,%1,%2,%3" :"=r"(ah),"=r"(al):"r"(b1),"r"(s3), "0"(ah),"1"(al));

#define _CONVOLVE_24 \
{ \
    _CONVOLVE_2a(0) _CONVOLVE_2b(1) _CONVOLVE_2a( 2) _CONVOLVE_2b( 3) \
    _CONVOLVE_2a(4) _CONVOLVE_2b(5) _CONVOLVE_2a( 6) _CONVOLVE_2b( 7) \
    _CONVOLVE_2a(8) _CONVOLVE_2b(9) _CONVOLVE_2a(10) _CONVOLVE_2b(11) \
}

int dsp_convolve( int xx, const int* cc, int* ss, int* ah_, int* al_, int nn )
{
    register int ah = *ah_, s0 = xx, b0, b1, s1, s2, s3; int al = *al_;
    while( nn-- ) { _CONVOLVE_24; cc += 24; ss += 24; }
    *ah_ = ah; *al_ = al; return s0;
}

static void _make_filter
(
    int coeffs[5],
    double b0, double b1, double b2, double a0, double a1, double a2
) {
    coeffs[0] = FQ( +b0/a0 );
    coeffs[1] = FQ( +b1/a0 );
    coeffs[2] = FQ( +b2/a0 );
    coeffs[3] = FQ( -a1/a0 );
    coeffs[4] = FQ( -a2/a0 );
}

void calc_notch( int coeffs[5], double frequency, double Q )
{
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, 1.0, -2*cos(w0), 1.0, 1+alpha, -2*cos(w0), 1-alpha );
}

void calc_lowpass( int coeffs[5], double frequency, double Q )
{
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, (1-cos(w0))/2, 1-cos(w0), (1-cos(w0))/2, 1+alpha, -2*cos(w0), 1-alpha );
}

void calc_highpass( int coeffs[5], double frequency, double Q )
{
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, (1+cos(w0))/2, -(1+cos(w0)), (1+cos(w0))/2, 1+alpha, -2*cos(w0), 1-alpha );
}

void calc_allpass( int coeffs[5], double frequency, double Q )
{
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, 1-alpha, -2*cos(w0), 1+alpha, 1+alpha, -2*cos(w0), 1-alpha );
}

void calc_bandpassQ( int coeffs[5], double frequency, double Q )
{
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, alpha, 0, -alpha, +1+alpha, -2*cos(w0), 1-alpha );
}

void calc_bandpassF( int coeffs[5], double frequency1, double frequency2 )
{
    double frequency = (frequency2 + frequency1) / 2;
    double w0 = 2.0 * pi * frequency;
    double bw = (frequency2 - frequency1) / frequency;
    double alpha = sin(w0) * sinh( log(2)/2 * bw * w0/sin(w0) );
    _make_filter( coeffs, alpha, 0, -alpha, +1+alpha, -2*cos(w0), 1-alpha );
}

void calc_peaking( int coeffs[5], double frequency, double Q, double gain )
{
    double A  = sqrt( pow(10,(gain/20)) );
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0) / (2.0 * Q);
    _make_filter( coeffs, 1+alpha*A, -2*cos(w0), 1-alpha*A, 1+alpha/A, -2*cos(w0), 1-alpha/A );
}

void calc_lowshelf( int coeffs[5], double frequency, double Q, double gain )
{
    double A = pow( 10.0, (gain / 40.0) );
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0)/2 * sqrt( (A + 1.0/A)*(1.0/Q - 1.0) + 2.0 );
    _make_filter(
        coeffs,
        A * ( (A+1) - (A-1)*cos(w0) + 2*sqrt(A)*alpha ),
        2*A * ( (A-1) - (A+1)*cos(w0) ),
        A * ( (A+1) - (A-1)*cos(w0) - 2*sqrt(A)*alpha ),
        (A+1) + (A-1)*cos(w0) + 2*sqrt(A)*alpha,
        -2 * ( (A-1) + (A+1)*cos(w0) ),
        (A+1) + (A-1)*cos(w0) - 2*sqrt(A)*alpha
    );
}

void calc_highshelf( int coeffs[5], double frequency, double Q, double gain )
{
    double A  = pow( 10.0, (gain / 40.0) );
    double w0 = 2.0 * pi * frequency;
    double alpha = sin(w0)/2.0 * sqrt( (A + 1.0/A)*(1.0/Q - 1.0) + 2.0 );
    _make_filter(
        coeffs,
        A * ( (A+1) + (A-1)*cos(w0) + 2*sqrt(A)*alpha ),
        -2*A * ( (A-1) + (A+1)*cos(w0) ),
        A * ( (A+1) + (A-1)*cos(w0) - 2*sqrt(A)*alpha ),
        (A+1) - (A-1)*cos(w0) + 2*sqrt(A)*alpha,
        2 * ( (A-1) - (A+1)*cos(w0) ),
        (A+1) - (A-1)*cos(w0) - 2*sqrt(A)*alpha
    );
}

void calc_tonestack( int* cc, double l, double m, double t, double v1, double v2, double v3 )
{
    double C1 = 0.25e-9, C2 = 20.0e-9, C3 = 20.0e-9; //C1 *= v1; C2 *= v2; C3 *= v3;
    double R1 = 250e3, R2 = 1e6, R3 = 25e3, R4 = 56e3;
    double Fs = 48000.0, k = 2 * Fs;
    double m2 = m * m;
    
    double b1=t*C1*R1+m*C3*R3+l*(C1*R2+C2*R2)+(C1*R3+C2*R3);
    double b2=t*(C1*C2*R1*R4+C1*C3*R1*R4)-m2*(C1*C3*R3*R3+C2*C3*R3*R3)+m*(C1*C3*R1*R3+C1*C3*R3*R3+C2*C3*R3*R3)+l*(C1*C2*R1*R2+C1*C2*R2*R4+C1*C3*R2*R4)+l*m*(C1*C3*R2*R3+C2*C3*R2*R3)+(C1*C2*R1*R3+C1*C2*R3*R4+C1*C3*R3*R4);
    double b3=l*m*(C1*C2*C3*R1*R2*R3+C1*C2*C3*R2*R3*R4)-m2*(C1*C2*C3*R1*R3*R3+C1*C2*C3*R3*R3*R4)+m*(C1*C2*C3*R1*R3*R3+C1*C2*C3*R3*R3*R4)+t*C1*C2*C3*R1*R3*R4-t*m*C1*C2*C3*R3*R3*R4+t*l*C1*C2*C3*R1*R2*R4;
    double a0=1;
    double a1=(C1*R1+C1*R3+C2*R3+C2*R4+C3*R4)+m*C3*R3+l*(C1*R2+C2*R2);
    double a2=m*(C1*C3*R1*R3-C2*C3*R3*R4+C1*C3*R3*R3+C2*C3*R3*R3)+l*m*(C1*C3*R2*R3+C2*C3*R2*R3)-m2*(C1*C3*R3*R3+C2*C3*R3*R3)+l*(C1*C2*R2*R4+C1*C2*R1*R2+C1*C3*R2*R4+C2*C3*R2*R4)+(C1*C2*R1*R4+C1*C3*R1*R4+C1*C2*R3*R4+C1*C2*R1*R3+C1*C3*R3*R4+C2*C3*R3*R4);
    double a3=l*m*(C1*C2*C3*R1*R2*R3+C1*C2*C3*R2*R3*R4)-m2*(C1*C2*C3*R1*R3*R3+C1*C2*C3*R3*R3*R4)+m*(C1*C2*C3*R3*R3*R4+C1*C2*C3*R1*R3*R3-C1*C2*C3*R1*R3*R4)+l*C1*C2*C3*R1*R2*R4+C1*C2*C3*R1*R3*R4;

    double B0 =       -b1*k -b2*k*k   -b3*k*k*k;
    double B1 =       -b1*k +b2*k*k +3*b3*k*k*k;
    double B2 =       +b1*k +b2*k*k -3*b3*k*k*k;
    double B3 =       +b1*k -b2*k*k   +b3*k*k*k;
    double A0 = -a0   -a1*k -a2*k*k   -a3*k*k*k;
    double A1 = -3*a0 -a1*k +a2*k*k +3*a3*k*k*k;
    double A2 = -3*a0 +a1*k +a2*k*k -3*a3*k*k*k;
    double A3 = -a0   +a1*k -a2*k*k   +a3*k*k*k;
    
    cc[0] = FQ(B0/A0); cc[1] = FQ(B1/A0); cc[2] = FQ(B2/A0); cc[3] = FQ(B3/A0);
    cc[4] = FQ(-A1/A0); cc[5] = FQ(-A2/A0); cc[6] = FQ(-A3/A0);
}

